better way to limit properties of a field in aggregate call<p>So I am trying to perform an <code>aggregate</code> call in MongoDB to lookup a collection but at the same time limit how much data I get from the other collection. Here's my attempt that kind of works: </p>

<pre><code>getFamilyStats: function (req, res) {
    Families
        .aggregate([
            { $match: { 'centralPath': req.body.centralPath }},
            { $lookup: {
                from: 'models',
                localField: 'centralPath',
                foreignField: 'centralPath',
                as: 'models'
            }},
            { $unwind: '$models'},
            { $project: {
                'models.openTimes.user': 1,
                '_id': 1,
                'centralPath': 1,
                'totalFamilies': 1,
                'unusedFamilies': 1,
                'oversizedFamilies': 1,
                'inPlaceFamilies': 1,
                'families': 1
            }}
            ]
        ).exec(function (err, response){
            var result = {
                status: 200,
                message: response
            };
            if (err){
                result.status = 500;
                result.message = err;
            } else if (!response){
                result.status = 404;
                result.message = err;
            }
            res.status(result.status).json(result.message);
        });
},
</code></pre>

<p>So the thing that works pretty well is the fact that I can use <code>lookup</code> to "join" data from a different collection, in this case called models. Once I <code>unwind</code> it it pretty much looks like I want it with the exception that I am only interested in one field from that property: <code>models.openTimes</code> and in this particular case actually just one property of that field <code>user</code>. I tried to use <code>project</code> to limit hom much of data i pass through from models, but that forces me to spell out all other fields like so: </p>

<pre><code>_id: 1,
centralPath: 1....
</code></pre>

<p>That's not ideal in case that my collection ever expands with new properties. I am looking for a way to limit data from <code>models</code> to just that one field/one property, but get all fields from <code>families</code> collection. </p>

<p>Ideas? </p>

<p>Sample data for families: </p>

<pre><code>{
    "_id" : ObjectId("5ae08c75d132ac4442520672"),
    "centralPath" : "some path",
    "totalFamilies" : 0,
    "unusedFamilies" : 0,
    "oversizedFamilies" : 0,
    "inPlaceFamilies" : 0,
    "families" : [],
    "__v" : 0
}
</code></pre>

<p>Sample data for models: </p>

<pre><code>{
    "_id" : ObjectId("5ae08c74d132ac4442520638"),
    "centralPath" : "some path",
    "openTimes" : [ 
        {
            "value" : 8123,
            "user" : "ks",
            "createdOn" : ISODate("2018-04-25T14:11:00.853Z"),
            "_id" : ObjectId("5ae08c74d132ac444252063a")
        }
    ],
    "synchTimes" : [ 
        {
            "value" : 208649,
            "user" : "ks",
            "createdOn" : ISODate("2018-04-25T16:42:42.933Z"),
            "_id" : ObjectId("5ae0b0028c2e3b192a3e9dc5")
        }
    ],
    "modelSizes" : [ 
        {
            "value" : 21483520,
            "user" : "ks",
            "createdOn" : ISODate("2018-04-25T14:11:00.787Z"),
            "_id" : ObjectId("5ae08c74d132ac4442520639")
        }
