how to use passport middleware in a controller<p>Trying to set up passport-local. Used this <a href="https://scotch.io/tutorials/easy-node-authentication-setup-and-local" rel="nofollow noreferrer">guide</a> as inspiration. </p>

<p>The problem I'm having is that when I call on the function from the routes-file, to the controller-file it wont work. If I put the code from controller-file in the routes-file it works. </p>

<p>This is my app.js</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>const express       = require('express');
const bodyParser    = require('body-parser');
const passport      = require('passport');
const flash         = require('connect-flash');
