Get distinct related data from arrays of ObjectIds on each document?<p>So I have a collection of <strong>Organizations</strong> like so:</p>

<pre><code>[
    {
        "name": "Organization 1",
        "locations": [
            "5b0096f064386ef34a5118d0", // Location 1
            "5b0096f064386ef34a5118d2" // Location 2
        ]
    },
    {
        "name": "Organization 2",
        "locations": [
            "5b0096f064386ef34a5118d0" // Location 1
        ]
    }
    // ~1,000 organizations ...
]
</code></pre>

<p>and a collection of <strong>Locations</strong> like so:</p>

<pre><code>[
    {
        // Location 1
        "_id": "5b0096f064386ef34a5118d0",
        "state": "AK",
        "city": "Adak"
    },
    {
        // Location 2
        "_id": "5b0096f064386ef34a5118d2",
        "state": "AK",
        "city": "Akhiok"
    },
    // ~36,000 locations ...
    {
        // Location 3
        "_id": "5b0096f064386ef34a51a63e",
        "state": "WY",
        "city": "Yoder"
    }
]
</code></pre>

<p>Each <strong>Organization</strong> has an array of location ids (which reference the <strong>Location</strong> collection).</p>

<p>I want to be able to get a list of distinct "used"/referenced Locations, with populated data (like city and state).</p>

<p>For example, in the above scenario I'd like to get back:</p>

<pre><code>[
    {
        // Location 1
        "_id": "5b0096f064386ef34a5118d0",
        "state": "AK",
        "city": "Adak"
    },
    {
        // Location 2
        "_id": "5b0096f064386ef34a5118d2",
        "state": "AK",
        "city": "Akhiok"
    }
]
</code></pre>

<p>...since Location 1 and Location 2 are the only ones that are actually referenced.</p>

<p>Any ideas on how I could achieve this?</p>

